public void formSetCaption()
{
    switch (exciseRegister)
    {
        case ExciseRegister_IN::DSA:
            this.design().caption("@GLS6442");
            break;
        case ExciseRegister_IN::PLA:
            this.design().caption("@GLS6474");
            break;
        case ExciseRegister_IN::RG23APartI:
            this.design().caption("@GLS6499");
            break;
        case ExciseRegister_IN::RG23APartII:
            this.design().caption("@GLS6501");
            break;
        case ExciseRegister_IN::RG23CPartI:
            this.design().caption("@GLS6511");
            break;
        case ExciseRegister_IN::RG23CPartII:
            this.design().caption("@GLS6513");
            break;
        case ExciseRegister_IN::RG23D:
            this.design().caption("@GLS6529");
            break;
        default:
            break;
    }
}

public void init()
{
    super();
    exciseRegistersInquiry  = new ExciseRegisterTransInquiry_IN();
    taxInquiryArguments = element.args().parmObject();
    if (taxInquiryArguments)
    {
        element.setValues(taxInquiryArguments);
    }
    element.formSetCaption();
    element.initSortList();
    element.updateDesign();
    element.menuItemEnableDisable();
}

public void  menuItemEnableDisable()
{
    rg23aItemDetails.enabled(exciseRegister == ExciseRegister_IN::RG23APartI ? true :false);
    rg23aTaxDetails.enabled(exciseRegister  == ExciseRegister_IN::RG23APartII ? true :false);
    rg23cItemDetails.enabled(exciseRegister == ExciseRegister_IN::RG23CPartI ? true :false);
    rg23cTaxDetails.enabled(exciseRegister  == ExciseRegister_IN::RG23CPartII ? true :false);
    rg23dDetails.enabled(exciseRegister     == ExciseRegister_IN::RG23D ? true :false);
    dsaDetails.enabled(exciseRegister       == ExciseRegister_IN::DSA ? true :false);
    plaDetails.enabled(exciseRegister       == ExciseRegister_IN::PLA ? true :false);
}

